 };

  return(
     <div className = "main_div"> 
       <div className = "center__div">
         <br />
         <h1> TODO List </h1>
         <br />
         <input type = "text" 
           placeholder = "Add an item"
           onChange = {itemEvent}
           value = {inputList}
         />
         <button> + </button>
         <ol>
           <li>{inputList}</li>
         </ol>
       </div>
     </div>
  )
};
export default App;
